[{"location":"#Schistoxpkg.jl-1","page":"Home","title":"Schistoxpkg.jl","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"A package to run an individual based mode of a schistosomiasis outbreak. ","category":"page"},{"location":"#","page":"Home","title":"Home","text":"All parameters are stored in the parameters.jl file in the src folder.","category":"page"},{"location":"#","page":"Home","title":"Home","text":"To run to equilibrium, a few functions need to be fun. After defining parameters we have to run \"contactratesbyage\" = makeagecontactratearray(maxage, scenario, [], []); to generate the contact rate by age array. After this, we have to run:","category":"page"},{"location":"#","page":"Home","title":"Home","text":"ages , deathages, gender, predisposition, community,    humancercariae, eggs, vacstatus,    treated, femaleworms, maleworms, agecontactrate,    vaccinated, envmiracidia, adherence, access =     createpopulationspecifiedages(N, Ncommunities, communityprobs, initialworms, contactratesbyage,                 wormstages, femalefactor, malefactor,initialmiracidia,                 initialmiracidiadays, predisaggregation, predisweight,                 timestep,                 specages, agesperindex, deathprobbyage, agesfordeaths,                 mdaadherence, mdaaccess)","category":"page"},{"location":"#","page":"Home","title":"Home","text":"deathages = [] for i in 1:N      push!(deathages, getdeathage(deathprobbyage, agesfordeaths)) end mean(deathages) ages, deathages = generateagesanddeaths(20000, ages, deathages, deathprobbyage, agesfordeaths)","category":"page"},{"location":"#","page":"Home","title":"Home","text":"agesequ, genderequ, predispositionequ,  humancercariaeequ, eggsequ, vacstatusequ, treatedequ, femalewormsequ, malewormsequ, vaccinatedequ, envmiracidiaequ, envcercariaeequ, recordhigh =     updateenvtoequilibrium(7600, copy(ages), copy(humancercariae), copy(femaleworms), copy(maleworms),     copy(community), communitycontactrate,         timestep, averagewormlifespan,         copy(eggs), maxfecundity, r, wormstages,         copy(vacstatus), copy(gender), predisaggregation,         copy(predisposition), copy(treated), vaccineeffectiveness,         densitydependentfecundity, copy(vaccinated), copy(envmiracidia),         copy(envcercariae), contactrate, envcercariaesurvivalprop, envmiracidiasurvivalprop,         femalefactor, malefactor, contactratesbyage, recordfrequency, copy(agecontactrate),humancercariaeprop,         miracidiamaturitytime)","category":"page"},{"location":"#","page":"Home","title":"Home","text":"","category":"page"},{"location":"#","page":"Home","title":"Home","text":"Modules = [Schistoxpkg]","category":"page"},{"location":"#Schistoxpkg.cercariae_uptake-NTuple{14,Any}","page":"Home","title":"Schistoxpkg.cercariae_uptake","text":"cercariaeuptake(envmiracidia, envcercariae, timestep, contactrate,     community, communitycontactrate, femaleworms, maleworms,     predisposition, agecontactrate, vacstatus, vaccineeffectiveness, humancercariaeprop,     miracidiamaturity_time)\n\nuptake cer\n\n\n\n\n\n","category":"method"},{"location":"#Schistoxpkg.create_population-NTuple{16,Any}","page":"Home","title":"Schistoxpkg.create_population","text":"create_population\n\nThis will create the initial human population with randomly chosen age, and gender.\n Predisposition is taken to be gamma distributed.\n There is also a male and female adjustment to predisposition adjusting for gender specific behaviour\n     In addition to this, it will create the initial miracidia environment vector\n\n\n\n\n\n","category":"method"},{"location":"#Schistoxpkg.create_population_specified_ages-NTuple{19,Any}","page":"Home","title":"Schistoxpkg.create_population_specified_ages","text":"create_population_specified_ages\n\nThis will create the initial human population with an age distribution specified by the spec_ages variable Predisposition is taken to be gamma distributed. There is also a male and female adjustment to predisposition adjusting for gender specific behaviour In addition to this, it will create the initial miracidia environment vector\n\n\n\n\n\n","category":"method"},{"location":"#Schistoxpkg.egg_production-NTuple{6,Any}","page":"Home","title":"Schistoxpkg.egg_production","text":"eggproduction(eggs, maxfecundity, r, wormpairs,                         densitydependentfecundity, timestep)\n\nfunction to produce eggs for individuals, dependent on how many worms they have     and the max fecundity and density dependent fecundity of the population\n\n\n\n\n\n","category":"method"},{"location":"#Schistoxpkg.update_contact_rate-Tuple{Any,Any,Any}","page":"Home","title":"Schistoxpkg.update_contact_rate","text":"update_contact_rate(ages, age_contact_rate, contact_rates_by_age)\n\nfunction to update the contact rate of individuals in the population. This is necessary     as over time when people age, they will move through different age groups which have     different contact rates\n\n\n\n\n\n","category":"method"},{"location":"#Schistoxpkg.worm_maturity-NTuple{5,Any}","page":"Home","title":"Schistoxpkg.worm_maturity","text":"wormmaturity(femaleworms, maleworms, wormstages,     averagewormlifespan, time_step)\n\nfunction to kill worms, and if there is more than one stage for worm life,     to update how many worms are in each stage\n\n\n\n\n\n","category":"method"}]
